import React from 'react';
import './login.css';




function Login() {
  return (
      <div className="login">
           <div className="login-container">
           <div className="login-form">
           <form action="">
                 <div className="logininp">
                     <label htmlFor="">Email </label>
                     <input type="text" />
                 </div>
                 <div className="logininp">
                     <label htmlFor="">Password</label>
                     <input type="text" type="" />
                 </div>
             </form>
           </div>
           </div>
      </div>
  );
}

export default Login;
